import './App.css';

function App() {

  const clickHandler = async () => {
    fetch('http://localhost:8000/')
    .then(response => {
      // console.log('tyk');
      // console.log(response.json());
      const timeDiv = document.getElementById('moscow_time');
      console.log(timeDiv)
      timeDiv.innerHTML = response.json();
      return;
    })
    .then(commits => alert(commits[0].author.login));
  }
  return (
    <div className="App">
      <input type="button" id="time" name="time" label="tyk" onClick={clickHandler}/>
      <div id="moscow_time"></div>
    </div>
  );
}

export default App;
